class ActionHelloWorld(Action):
    def name(self) -> Text:
        return "action_suggest_restaurant_name"

    def run(self, dispatcher: CollectingDispatcher,
            tracker: Tracker,
            domain: Dict[Text, Any]) -> List[Dict[Text, Any]]:
        cuisine = tracker.get_slot("cuisine").lower()
        if cuisine in restaurants:
            dispatcher.utter_message(text=f"what about {random.choice(restaurants[cuisine])}?")
        else:
            restaurant_name = random.choice(restaurants["take-out"])
            dispatcher.utter_message(text=f"what about {restaurant_name}?")
        return []
